/*global define */

define(
    'vks/model/exerciseModel',
    [
        'backbone',
        'vks/module/numberFormatter'
    ],
    function (BB, numberFormatter) {
        'use strict';

        return BB.Model.extend({

            isCorrect: function () {
                var correct = true;
                var correctAnswerIndex = this.get('correctAnswerIndex');
                var selectedAnswerIndex = this.get('selectedAnswerIndex');
                
                for(var i=0;i<correctAnswerIndex.length;i++){
                    if(selectedAnswerIndex[i] !== correctAnswerIndex[i]) correct = false;
                }
                
                return correct;
            },

            getAlphabeticalAnswerIndex: function () {
                var responseLetter,
                    responseLetterSubstitutions = {
                        0: 'A',
                        1: 'B',
                        2: 'C'
                    };

                if (this.get('selectedAnswerIndex') === null) {
                    responseLetter = 'X';// no answer selected
                } else {
                    responseLetter = responseLetterSubstitutions[this.get('selectedAnswerIndex')];
                }

                return (responseLetter === undefined) ? '?' : responseLetter;
            },

            getNumExercisesFormatted: function () {
                return numberFormatter.twoDigitsMin(this.get('numExercises'));
            },

            getExerciseIndexFormatted: function () {
                return numberFormatter.twoDigitsMin(this.get('exerciseIndex'));
            },

            getTheory: function () {
                return this.get('theory');
            },

            toJSON: function () {
                return _.extend(
                    BB.Model.prototype.toJSON.apply(this, arguments),
                    {
                        isCorrect: this.isCorrect(),
                        numExercisesFormatted: this.getNumExercisesFormatted(),
                        exerciseIndexFromatted: this.getExerciseIndexFormatted()
                    }
                );
            },

            defaults: {
                question: '',
                answers: [],
                exerciseId: 0,// the unique identifier of the exercise
                exerciseIndex: 0,// the index of the exercise in the current exercise collection
                numExercises: 0,
                theory: '',
                correctAnswerIndex: [],
                selectedAnswerIndex: [],
                options: {
                    multipleChoice: false
                }
            }
        });
    }
);

