/*global define */

define(
    'vks/model/reportModel',
    [
        'backbone',
        'vks/module/numberFormatter'
    ],
    function (BB, numberFormatter) {
        'use strict';

        return BB.Model.extend({

            getNumCorrectAnswersFormatted: function () {
                var amount = this.get('exercises').filter(function (exercise) {
                    return exercise.isCorrect();
                }).length;

                return numberFormatter.twoDigitsMin(amount);
            },

            getNumExercisesFormatted: function () {
                return numberFormatter.twoDigitsMin(this.get('exercises').size());
            },
            
            getMaxPoints: function () {
                
                var maxPoints = this.get('exercises').map(function(exercise){
                    return exercise.attributes.correctAnswerIndex.length;
                }).reduce(function(memo, num){
                    return memo + num;
                }, 0);
                
                return maxPoints;
            },
            
            getMaxPointsFormatted: function () {
                return numberFormatter.threeDigitsMin(this.getMaxPoints());
            },
             
            getErrorsFormatted: function () {
                var counterWrong = 0;

                // Do not display error counter if we're not
                // in multiple choice mode.
                if (!this._exercisesHaveMultipleChoice()) {
                    return null;
                }
                
                for(var ei=0;ei<this.get('exercises').size();ei++){
                    
                    var exerciseData = this.get('exercises').models[ei].attributes;
                    var correctAnswerIndex = exerciseData.correctAnswerIndex;
                    var selectedAnswerIndex = exerciseData.selectedAnswerIndex;
                    
                    var correctAnswersCount = correctAnswerIndex.filter(function (answer) {
                        return answer ? 1 : null;
                    }).length;
                    var selectedAnswersCount = selectedAnswerIndex.filter(function (answer) {
                        return answer ? 1 : null;
                    }).length;

                    if (selectedAnswersCount === 3 || selectedAnswersCount === 0) {
                        counterWrong += 3;
                    } else {
                        for(var ai=0;ai<correctAnswerIndex.length;ai++){
                            if(correctAnswerIndex[ai] !== selectedAnswerIndex[ai]){
                                counterWrong++;
                            }
                        }
                    }
                }
                
                return counterWrong;
            },

            /**
             * Returns true if an exercise has multiple
             * choice option enabled at least.
             *
             * @returns {boolean}
             */
            _exercisesHaveMultipleChoice: function () {
                var haveMultipleChoice = false;

                this.get('exercises').filter(function (exercise) {
                    haveMultipleChoice = exercise.get('options').multipleChoice;
                });

                return haveMultipleChoice;
            },

            toJSON: function () {
                return _.extend(
                    BB.Model.prototype.toJSON.apply(this, arguments),
                    {
                        numCorrectAnswers: this.getNumCorrectAnswersFormatted(),
                        numExercisesFormatted: this.getNumExercisesFormatted(),
                        exercises: this.get('exercises').toJSON(),
                        maxPoints: this.getMaxPointsFormatted(),
                        errors: this.getErrorsFormatted()
                    }
                );
            },

            defaults: {
                totalDuration: 0,//ms
                exercises: [],
                overlayInfo: null
            }
        });
    }
);

/*global define */

define(
    'vks/view/baseView',
    [
        'jquery',
        'backbone',
        'vks/view/exerciseView',
        'vks/model/exerciseModel',
        'vks/model/exerciseCollection',
        'vks/view/overlayView',
        'vks/model/glossaryItemCollection'
    ],
    function ($, BB, ExerciseView, ExerciseModel, ExerciseCollection, Overlay, GlossaryCollection) {
        'use strict';

        return BB.View.extend({

            // DOM nodes
            _controls: null,
            _exerciseContainer: null,
            _reportContainer: null,
            _overlayInfo: null,
            _sidebarBoxGlossary: null,
            _startBt: null,
            _nextBt: null,
            _prevBt: null,
            _alert: null,

            // views, data
            _exerciseViewInst: null,
            _reportViewInst: null,
            _exercises: null,
            _currentExerciseIndex: 0,
            _hiddenClass: 'is-hidden',
            _confirmFinish: false,
            _glossary: null,

            _displayAlert: function (templateId, values) {
                var that = this;

                this._alert.addContent(templateId, {values: values}, 'alert');

                $('.exercise-control-finish-no-warning').on('click', function (e) {
                    e.preventDefault();
                    that._confirmFinish = true;
                    that._handleFinishBtClick(e);
                });

                $('.exercise-control-cancel-report').on('click', function (e) {
                    that._backToExam(e);
                });

                this._alert.showOverlay();
            },

            _backToExam: function (e) {
                e.preventDefault();
                this._alert.hideOverlay();
            },

            _exercisesNotAnswered: function () {
                var exercises = [],
                    exercise,
                    i;

                for (i = 0; i < this._exercises.length; i += 1) {
                    exercise = this._exercises.at(i);

                    if (exercise.attributes.selectedAnswerIndex === null) {
                        exercises.push(exercise.attributes.exerciseIndex);
                    }
                }

                return exercises;
            },

            _getExercises: function () {
                var that = this;
                
                this._exercises.fetch({
                    success: function () {
                        that._updateExercise(that._currentExerciseIndex);
                    }
                });
            },

            _handleStartBtClick: function (e, getParameters) {
                var that = this;

                getParameters = getParameters || null;

                if (e) {
                    e.preventDefault();
                }

                this._startBt.addClass(this._hiddenClass);
                this._exerciseContainer.removeClass(this._hiddenClass);
                this._controls.removeClass(this._hiddenClass);
                
                this._exercises = new ExerciseCollection(getParameters);
                this._getExercises();
                if (getParameters == null || !getParameters.hasOwnProperty('demo')) {
                    this._glossary = new GlossaryCollection();
                    this._glossary.fetch({
                        success: function () {
                            that._glossary = that._glossary.rearrangeCollection();
                        }
                    });
                }
            },

            _handleNextBtClick: function (e) {
                e.preventDefault();

                this._updateExercise(this._currentExerciseIndex + 1);
            },

            _handlePrevBtClick: function (e) {
                e.preventDefault();

                this._updateExercise(this._currentExerciseIndex - 1);
            },

            _handleFinishBtClick: function (e) {
                e.preventDefault();

                this._controls.addClass(this._hiddenClass);
                this._exerciseViewInst.remove();
                this._reportContainer.removeClass(this._hiddenClass);
                this._reportViewInst.render();
            },

            _handleGlossaryIndexBtClick: function (e) {
                var divId,
                    divContent,
                    offset = 0,
                    mediaQuery;

                e.preventDefault();
                divContent = $(e.target).closest('.overlay-content');
                divId = $(e.target).attr('href');
                mediaQuery = window.getComputedStyle($('body')[0], ':before').content;

                //scroll differently on mobile
                if (mediaQuery  === 'mobile') {
                    offset = 120;
                    divContent = $('body');
                }

                divContent.scrollTop($(divId).position().top - offset);
            },

            _handleGlossaryBtClick: function (e) {
                e.preventDefault();

                if (this._overlayInfo.isClosed() || this._overlayInfo.getContentType() === 'theory') {
                    window.scrollTo(0, 0);
                    this._overlayInfo.addContent('tp-glossary', {glossary: this._glossary}, 'glossary');
                    this._overlayInfo.showOverlay();
                } else {
                    this._overlayInfo.hideOverlay();
                }
            },

            _handleGlossaryBackTopBtClick: function (e) {
                var mediaQuery = window.getComputedStyle($('body')[0], ':before').content;

                if (mediaQuery === 'desktop') {
                    e.preventDefault();

                    $(e.target).closest('.overlay-content').scrollTop(0);
                }
            },

            _updateExercise: function (index) {
                this._prevBt.removeClass(this._hiddenClass);
                this._nextBt.removeClass(this._hiddenClass);

                if (index <= 0) {
                    index = 0;
                    this._prevBt.addClass(this._hiddenClass);
                } else if (index >= this._exercises.size() - 1) {
                    index = this._exercises.size() - 1;
                    this._nextBt.addClass(this._hiddenClass);
                }

                this._exerciseViewInst.model = this._exercises.at(index);
                this._exerciseViewInst.render();
                this._currentExerciseIndex = index;
            },

            events: {
                'click .pure-button-start-exercise': '_handleStartBtClick',
                'click .exercise-control-next': '_handleNextBtClick',
                'click .exercise-control-prev': '_handlePrevBtClick',
                'click .exercise-control-finish': '_handleFinishBtClick',
                'click .display-glossary-button': '_handleGlossaryBtClick',
                'click .glossary-back-top': '_handleGlossaryBackTopBtClick',
                'click .glossary-index-letter': '_handleGlossaryIndexBtClick'
            },

            initialize: function () {
                this._startBt = this.$el.find('.pure-button-start-exercise');
                this._controls = this.$el.find('.exercise-controls');
                this._exerciseContainer = this.$el.find('.exercise');
                this._reportContainer = this.$el.find('.report');
                this._sidebarBoxGlossary = this.$el.find('.sidebar-box-glossary');
                this._nextBt = this._controls.find('.exercise-control-next');
                this._prevBt = this._controls.find('.exercise-control-prev');
                this._alert = new Overlay({
                    el: $('.overlay-alert')
                });
                this._overlayInfo = new Overlay({
                    el: $('.overlay-info')
                });

                this._exerciseViewInst = new ExerciseView({
                    el: this._exerciseContainer
                });
            }
        });
    }
);

