/*global define, setInterval, clearInterval */

define(
    'vks/view/examView',
    [
        'jquery',
        'vks/view/baseView',
        'vks/view/reportView',
        'vks/model/reportModel',
        'vks/model/exerciseCollection'
    ],
    function ($, BaseView, ReportView, ReportModel, ExerciseCollection) {
        'use strict';

        var ExamView = BaseView.extend({

            // DOM nodes
            _sidebarBoxCountdown: null,
            _sidebarBoxExerciseList: null,
            _countdown: null,
            _timeLimit: 3000, /* 50 minutes in seconds */
            _time: null,
            _counter: null,

            _timer: function (that) {
                that._time = that._time - 1;

                if (that._time <= 0) {
                    clearInterval(that._counter);
                    that._countdown.text(that._secondsToDisplay(that._time));
                    that._displayAlert('tp-timesup', null);
                    return;
                }

                that._countdown.text(that._secondsToDisplay(that._time));
            },

            _secondsToDisplay: function (time) {
                var timeInText = '';

                if (Math.floor(time / 60) < 10) {
                    timeInText += '0' + Math.floor(time / 60);
                } else {
                    timeInText += Math.floor(time / 60);
                }

                timeInText += ":";

                if (time % 60 < 10) {
                    timeInText += '0' + time % 60;
                } else {
                    timeInText += time % 60;
                }

                return timeInText;
            },

            _getExercises: function () {
                var that = this;

                this._exercises.fetch({
                    success: function () {
                        that._updateExercise(that._currentExerciseIndex);
                        that._counter = setInterval(function () {
                            that._timer(that);
                        }, 1000);
                    }
                });
            },

            _handleStartBtClick: function (e) {
                BaseView.prototype._handleStartBtClick.call(this, e, null);

                this._sidebarBoxCountdown.removeClass(this._hiddenClass);
                this._sidebarBoxExerciseList.removeClass(this._hiddenClass);
                this._countdown.text(this._secondsToDisplay(this._time));
            },

            _handleExerciseBtClick: function (e) {
                e.preventDefault();
                $('.exercise-list-item:nth-child(' + (this._currentExerciseIndex + 1) + ')').toggleClass('is-active');
                this._updateExercise(e.target.innerHTML - 1);
            },

            _handleAnswerSelectionClick: function () {
                $('.exercise-list-item:nth-child(' + (this._currentExerciseIndex + 1) + ')').addClass('is-answered');
            },

            _handlePrevBtClick: function (e) {
                $('.exercise-list-item:nth-child(' + (this._currentExerciseIndex + 1) + ')').toggleClass('is-active');
                BaseView.prototype._handlePrevBtClick.call(this, e);
            },

            _handleNextBtClick: function (e) {
                $('.exercise-list-item:nth-child(' + (this._currentExerciseIndex + 1) + ')').toggleClass('is-active');
                BaseView.prototype._handleNextBtClick.call(this, e);
            },

            _updateExercise: function (index) {
                BaseView.prototype._updateExercise.call(this, index);
                $('.exercise-list-item:nth-child(' + (index + 1) + ')').toggleClass('is-active');
            },

            _handleFinishBtClick: function (e) {
                if (this._confirmFinish) {
                    clearInterval(this._counter);

                    this._alert.hideOverlay();
                    this._sidebarBoxCountdown.addClass(this._hiddenClass);
                    this._sidebarBoxExerciseList.addClass(this._hiddenClass);
                    this._sidebarBoxGlossary.removeClass(this._hiddenClass);

                    this._reportViewInst = new ReportView({
                        el: this._reportContainer,
                        model: new ReportModel({
                            totalDuration: this._secondsToDisplay(this._timeLimit - this._time),
                            exercises: this._exercises,
                            overlayInfo: this._overlayInfo
                        })
                    });

                    this.$el.find('.content-block-aside').removeClass('content-block-aside').addClass('content-block-aside-top');
                    this.$el.find('.content-block-main').removeClass('content-block-main-exam').addClass('content-block-main-with-top-bar');
                    BaseView.prototype._handleFinishBtClick.call(this, e);
                } else {
                    this._displayAlert('tp-notfinished', this._exercisesNotAnswered());
                }
            },

            initialize: function (parameters) {
                ExamView.__super__.initialize.call(this);
                if (parameters.category === 'river') {
                    this._timeLimit = 1200;
                }
                this._countdown = this.$el.find('.sidebar-box-countdown-timeLeft');
                this._sidebarBoxCountdown = this.$el.find('.sidebar-box-countdown');
                this._sidebarBoxExerciseList = this.$el.find('.exercise-list');
                this.events['click .exercise-list-item'] = '_handleExerciseBtClick';
                this.events['click .exercise-answer'] = '_handleAnswerSelectionClick';
                this._time = this._timeLimit;
            }
        });

        return ExamView;
    }
);

